import React, { Component } from 'react'
import loading from './loading.gif'

export default class Loading extends Component {
  render() {
    return (
      <div className="text-center d-flex justify-content-center align-items-center" style={{height:'40vh'}}>
        <img src={loading} alt="Loader" className="h-100"></img>
      </div>
    )
  }
}
